import React from "react";
import "../styles/Console.css";

const consoles = [
  { id: 1, name: "PS5", image: "/io" },
  { id: 2, name: "PS4", image: "/images/ps4.png" },
  { id: 3, name: "Nintendo", image: "/images/nintendo.webp" },
  { id: 4, name: "Xbox", image: "/images/xbox.webp" },
  { id: 5, name: "Handheld PC", image: "/images/handheld.webp" },
  { id: 6, name: "Meta Quest", image: "/images/metaquest.webp" },
  { id: 7, name: "Retro", image: "/images/retro.webp" },
];

export default function Console() {
  return (
    <div className="console-page">
      <h1>LOáº I</h1>
      <div className="console-list">
        {consoles.map((item) => (
          <div key={item.id} className="console-card">
            <img src={item.image} alt={item.name} />
            <p>{item.name}</p>
          </div>
        ))}
      </div>
    </div>
  );
}
